function buildStepsBreadcrumb(n,t,i){const r=n.getFormElement(),u=r.querySelectorAll(".steps .step");u.forEach(function(t){let r=t.querySelector("a").dataset.stepHref;const u=t=>{t.preventDefault(),n.revealStep(r)};t.classList.add("step");t.classList.remove("step-active");i[r].active&&t.classList.add("step-active");t.addEventListener("click",u)})}function onStepChange(n,t){const i=n.getBreadcrumb();buildStepsBreadcrumb(n,t,i)}